import React from 'react';
import { 
    Footer, 
    Footercontainer, 
    FooterMenu,
    FooterItem,
    FooterLinks,
    } from './SFooter'; 

const NFooter = () => {
  return (
    <div>
         <Footer>
          <Footercontainer>
                                      
              <FooterMenu>

                  <FooterItem>
                      <FooterLinks to = "home">  Create your own Blog </FooterLinks>
                  </FooterItem>

                  <FooterItem>
                      <FooterLinks to = "login"> Log In </FooterLinks>
                  </FooterItem>                  
              </FooterMenu>

            </Footercontainer>
        </Footer>
    </div>
  );
}

export default NFooter;
